import React from 'react';
import { cpus } from 'os';

const Card = (props) => {
    const cWidth = 485;
    const cHeight = 300;
    const cPadding = 10;
    const cHeadFoot = 0.1;

    return (
        <div class="card">
            <div class="card-body">
                <p class="card-text">
                    this is some text within a card body.
            </p>

            </div>
        </div>
    )
}

export default Card;
